// src/components/Header.js
import React from "react";
import "./Header.css";

const Header = () => {
  return (
    <header>
      <img
        src="/icons/nppf logo.webp" // Correct path for Create React App
        alt="NPPF Logo"
        className="logo"
      />
      <div className="content">
        <h1>Welcome to NPPF Service Feedback System</h1>
      </div>
    </header>
  );
};

export default Header;
